import React, { Component } from 'react'
import "./maintab.css";

export class MainTab extends Component {
  render() {
    return (
      <div className='fixed h-screen'>
        <ul className='text-lg text-white font-grotesk'>
          <li>up</li>
          <li>work</li>
        </ul>
      </div>
    )
  }
}

export default MainTab
